There are two sides to every woman. This is a story about the other one. Jenny is a sexually uptight girl who masturbates a lot in front of the mirror in her home. And laughs at her image, then asks &quot;Was it good for you?&quot; One day when the mirror answers back it is not the answer she wants to hear. And when the mirror starts to do things Jennifer would never think of, the results are disconcerting to say the least. Michael Zen presents Nikki Tyler in his reflection of reflection, with and alter ego running wild in a fun house mirror Flipside. It's your ticket to the other side. Enjoy!
